import React from 'react';
import { NavLink } from 'react-router-dom';
import './Footer.css'; // Asegúrate de que la ruta al archivo CSS sea correcta

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <div className="footer-section">
          <h4>Enlaces Rápidos</h4>
          <NavLink to="/conócenos" className="footer-link">Conócenos</NavLink>
          <NavLink to="/logros" className="footer-link">Logros</NavLink>
          <NavLink to="/admision" className="footer-link">Admisión</NavLink>
        </div>
        <div className="footer-section">
          <h4>Contacto</h4>
          <p>Dirección: 123 Calle Falsa, Ciudad</p>
          <p>Teléfono: +1 234 567 8900</p>
          <p>Email: contacto@example.com</p>
        </div>
        <div className="footer-section">
          <h4>Síguenos</h4>
          {/* Enlaces a redes sociales o similar */}
          <a href="http://facebook.com" className="footer-link"><img src='../icons8-facebook-nuevo.svg' alt='Logo de Facebook'/></a>
          <a href="http://instagram.com" className="footer-link"><img src='../icons8-instagram.svg' alt='Logo de instagram'/></a>
          <a href="http://github.com" className="footer-link"><img src='../icons8-facebook-nuevo.svg' alt='Logo de GitHub'/></a>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
